import React, { useEffect, useRef } from "react";
import Earth from "./Earth";

const ObjectCreatorEarth = React.forwardRef(({ objectIndex }, ref) => {
        useEffect(() => {
                const objectCreatorEarthElement = ref.current;
                if (objectCreatorEarthElement) {
                        const { width, height } = objectCreatorEarthElement.getBoundingClientRect();
                        console.log("Размер ObjectCreatorEarth:", width, height);
                }
        }, [ref]);

        if (objectIndex >= 0 && objectIndex <= 99) {
                return <Earth ref={ref} />;
        } else {
                return null;
        }
});

export default ObjectCreatorEarth;
